import React from "react";

const Home = () => {
  return (
    <div className="home">
      <div className="card home-card">
        <h5>Tom Mitch</h5>
        <div className="card-image">
          <img
            src="https://images.unsplash.com/photo-1480487453552-4d3c7d1d65e1?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60"
            alt="_blank"
          />
        </div>
        <div className="card-content">
          <i class="material-icons">favorite</i>
          <h6>title</h6>
          <p>this is amazing post</p>
          <input type="text" placeholder="add a comment" />
        </div>
      </div>
    </div>
  );
};

export default Home;
